import ListPage from "./list";
import Header from "../components/Header";
import Footer from "../components/Footer";
import Layout from "../components/Layout";


export default function basePage() {
  return (
    <div>
      <Header />
      <Layout>
        <ListPage />
      </Layout>
      <Footer />
    </div>
  )
}
